var _=require("lodash"),Category=require("./category"),User=require("./user"),notes=[{id:1,userId:13,categoryId:8,description:"NgModel Best Practice",content:"Always use dot syntax when using NgModel! Treat Scope as read-only in templates & write-only in controllers. The purpose of the scope is to refer to the model, not be the model. The model is your javascript objects. When doing bidirectional binding with ngModel make sure you don't bind directly to the scope properties. This will cause unexpected behavior in the child scopes.",title:"NgModel BP"},{id:2,userId:2,categoryId:3,description:"Markers on a **DOM element** that tell AngularJS's HTML compiler `$compile` to attach a specified behavior to that DOM element.",title:"Directives",content:"Markers on a **DOM element**"},{id:3,userId:1,categoryId:6,description:"Clarify the confusion between Service the term and `service` the angular method and to explain the 5 different Service recipes in Angular.",title:"Service Service? Really Angular?",content:"There are 5 Recipes used to create a Service. One of those *was* unfortunately named, Service. So yes, amongst its fellow peers such as Provider Service and Factory Service, there is in fact a Service Service."},{id:4,userId:2,categoryId:6,description:"QUESTIONABLE DESCRIPTION GOES HERE",title:"TEST TEST TEST",content:"QUESTIONABLE CONTENT GOES HERE"},{id:5,userId:4,categoryId:6,description:"Define Service",title:"What is a Service",content:"Service: Angular services are objects that are wired together using dependency injection (DI). You can use services to organize and share code across your app."},{id:6,userId:5,categoryId:6,description:"Steps for Creating a Service",title:"How do you create a Service?",content:"You can register a service to our Angular module `app` with a one of the following 5 recipes: \\n 	- **factory**  \\n 	- **provider**  \\n 	- **service**  \\n 	- **value**  \\n 	- **constant** "}],lastId=6,buildNotes=function(){for(var e,t=JSON.parse(JSON.stringify(notes)),r=[],o=0,i=t.length;i>o;o++)e=t[o],e.user=User.get(e.userId),e.category=Category.get(e.categoryId),r.push(e);return r};module.exports={get:function(e){return _.find(buildNotes(),function(t){return t.id===e})},all:function(){return buildNotes()},update:function(e){for(var t,r=0,o=notes.length;o>r;r++)if(notes[r].id===e.id){_.assign(notes[r],e),t=notes[r];break}return t},"delete":function(e){for(var t,r=0,o=notes.length;o>r;r++)if(notes[r].id===e){t=notes[r],notes.splice(r,1);break}return t},create:function(e){return lastId+=1,e.id=lastId,notes.push(e),e}};